import './App.css';
import { BrowserRouter , Route , Routes } from "react-router-dom";
import Header from './components/Header/Header'; //Header 컴포넌트 임포트
import LeftArea from './components/Header/Contents/LeftArea/LeftArea'; //LeftArea 컴포넌트 임포트
import Rule from './components/Header/Contents/Rule/Rule';
function App() { 
  return (
    <BrowserRouter>
      <div>
        <Header />
        <Routes>
          <Route exact path="/">
              <LeftArea />
          </Route>
          <Route path="/Rule">
            <Rule />
          </Route>
        </Routes>
      </div>
    </BrowserRouter>

  );
}

export default App;
